import React from "react"
import Header from "./components/Header";
import Footer from "./components/Footer";
import './css/index.css';
import Bar from "./components/Bar";



function App() {
    return (
        <div className="wrapper">
            <Header />
            <Footer />
            <Bar />
        </div>
    );
}

export default App;
